class AllExpanses extends Component{
    state = {
        data: {
            columns: [
                {
                    label: 'Name',
                    field: 'Product_Name',
                    sort: 'asc',
                    width: 150
                },
                {
                    label: 'C.Name',
                    field: 'Category_Name',
                    sort: 'asc',
                    width: 270
                },
                {
                    label: 'P.Brand',
                    field: 'Product_Brand',
                    sort: 'asc',
                    width: 200
                },
                {
                    label: 'P.Code',
                    field: 'Product_Code',
                    sort: 'asc',
                    width: 100
                },
                {
                    label: 'Qty',
                    field: 'qty',
                    sort: 'asc',
                    width: 150
                },
                {
                    label: 'R.Price',
                    field: 'Product_Retail_Price',
                    sort: 'asc',
                    width: 350
                },
                {
                    label: 'Profit',
                    field: 'Profit',
                    sort: 'asc',
                    width: 350
                },
            ],
            rows: []
        },
        grossProfit: 0
    };

    render() {
        return <h1>Working</h1>;
    }
}

export default AllExpanses;
